import React, {useState} from "react";
import SubjectCard from "./SubjectCard";
import ModalBox from "./ModalBox";




const Resources = ()=> {
  const subs = [

    { id: 1,
      
    subName: "AC",

    books:
    
      ["https://drive.google.com/file/d/1pW5UhJ1VoBuffAl62dqDJQhEvz3nRTic/preview",
      "https://drive.google.com/file/d/1DjH_RabG3iPxeBq-a-xft9o6NdWYayJ3/preview",
      "https://drive.google.com/file/d/1ZM4_O4qgwUy-JsJP6g_PY2Cx3ryIRQPp/preview"
      ],
      
      notes:
      ["https://drive.google.com/file/d/1MWh1RAv96bWS2gPWfA84AX9cjrjmcHpi/preview",
      "https://drive.google.com/file/d/14QPLid8Icp31FvGQJJzLYS5Bw1R3Xoe8/preview",
      ],
    
    yt:
      [
      "https://www.youtube.com/embed/kAs8OerKRmc"
      ]},
                
      { id: 2,
        
        subName: "CE",
        
        books:
          ["https://drive.google.com/file/d/1qUDrqGRa5TOtu8e6HyGnbpE_cCq7YcSa/preview",
          "https://drive.google.com/file/d/1siPu8H3oaTKpzNfhpiRQ3vYbAtBYWYhE/preview"
        ],
        
        notes:
        ["https://drive.google.com/drive/folders/1S5IMrkhVA_f1ExkHj4gtAyKqIaXCYh5q"
        ],
        
        yt:
        ["https://www.youtube.com/embed/u7u49FE5H-c"
        ]},
        
        { id: 3,
          
        subName: "ES",
        
        books:
          ["https://drive.google.com/file/d/1Z2Ozj9Kc2LwSSpuNizyF4D9kpsAmbXRx/preview",
          "https://drive.google.com/file/d/1QV38jMXhKa6oQP7etXDAUBN2Glzijq4q/preview"
          ],
        
          notes:
          ["https://docs.google.com/presentation/d/1duzJRzoEDXSET0wQdq5Al7dC-Nw6qRDZ/preview",
          "https://drive.google.com/drive/folders/1YPeROAMiNOp9fJcPwt7Jb4_FWzAgkGzi?usp=sharing"
        ],
        
        yt: ["!", "@", "#"]},
                { id: 4, subName: "MI", books: ["b", "c", "d"], notes: ["1", "2", "3"], yt: ["!", "@", "#"]},
                { id: 5, subName: "WA", books: ["a", "b", "c"], notes: ["1", "2", "3"], yt: ["!", "@", "#"]},
                { id: 6, subName: "CAO", books: ["b", "c", "d"], notes: ["1", "2", "3"], yt: ["!", "@", "#"]},
                { id: 7, subName: "CMOS", books: ["a", "b", "c"], notes: ["1", "2", "3"], yt: ["!", "@", "#"]},
                { id: 8, subName: "ESD", books: ["b", "c", "d"], notes: ["1", "2", "3"], yt: ["!", "@", "#"]},
                { id: 9, subName: "ALGO", books: ["b", "c", "d"], notes: ["1", "2", "3"], yt: ["!", "@", "#"]}
              ];

  const [modalContent, setModalContent] = useState(null);

  const showModal = (sub)=>{
    setModalContent(sub);
  }

  return(
    <section id="resources">

    <div className="flex justify-center">
      <div className="mx-auto text-center text-4xl rounded bg-teal-accent-400 shadow-xl my-10 px-6 py-3 text-white">Resources</div>
    </div>

    <div className="flex justify-center flex-wrap relative bg-gray-100">

      {subs.map((sub)=>{
        return (<SubjectCard key={sub.id} data={sub} call={showModal} />);
      })}

      {
        modalContent? <ModalBox modalContent={modalContent} call={showModal} />: null
      }
    </div>
    </section>
  );

}

export default Resources;
